import './App.css';
import RegistrationForm from './components/Registration/Registration';
import ProfilePage from './components/Profile/ProfilePage'; // Import the ProfilePage component
import { BrowserRouter as Router, Routes, Route, Link, useNavigate } from 'react-router-dom'; // Import the necessary routing components

function App() {
  const navigate = useNavigate(); // Initialize the useNavigate hook

  return (
    <Router>
      <div>
        <nav>
          <ul>
            <li>
              <Link to="/registration">Registration</Link> {/* Add a link to the registration page */}
            </li>
            <li>
              <Link to="/profile">Profile</Link> {/* Add a link to the profile page */}
            </li>
          </ul>
        </nav>

        <Routes>
          <Route path="/registration" element={<RegistrationForm navigate={navigate} />} /> {/* Pass the navigate function as a prop to the RegistrationForm component */}
          <Route path="/profile" element={<ProfilePage />} /> {/* Add a route for the profile page */}
        </Routes>
      </div>
    </Router>
  );
}

export default App;

